import React, { useState } from "react";
import usersData from "./usersData";

const Users = () => {
  const [userIndex, setUserIndex] = useState(0);

  const infoUsers = (index) => {
    setUserIndex(index);
  };

  return (
    <div>
      <button onClick={() => infoUsers(0)}>User 1</button>
      <button onClick={() => infoUsers(1)}>User 2</button>
      <div className="Card">
        <ul>
          <li>{usersData[userIndex].name}</li>
          <li>{usersData[userIndex].age}</li>
          <li>{usersData[userIndex].email}</li>
        </ul>
      </div>
    </div>
  );
};

export default Users;
